from tkinter import PhotoImage
import base64


class CpBase64:

	__slots__ = []

	def decod_b64(self, img64):
		return PhotoImage(data=base64.b64decode(img64))

	def get_imgtop(self):
		img_b64 = ''
		return self.decod_b64(img_b64)

